import React from 'react';

import { SpinnerContainer, SpinnerContianer, SpinnerOverlay } from './with-spinner.styles';

const WithSpinner = WrappedComponent => ({isLoading, ...otherProps})=>{
   return isLoading ?(
      <SpinnerOverlay>
         <SpinnerContainer/>
      </SpinnerOverlay>
   ):(
      <WrappedComponent {...otherProps}/>
   );
};

export default WithSpinner;
